import React from 'react';
import { Carousel } from 'react-bootstrap';

function Carrusel() {
  return (
    <>
    <div style={{padding:"50px"}}>

      <Carousel interval={3000} data-bs-theme="dark">
        {/* Cambia 3000 a la cantidad de milisegundos que deseas para el intervalo */}
        <Carousel.Item >
          <img
            
            src={`https://www.arcgis.com/sharing/rest/content/items/b023006af3334d16ba9cff9d746af31d/resources/images/widget_2217/1690929701335.jpg`}
            alt="First slide"
            
          />

        </Carousel.Item>
        <Carousel.Item>
          <img
            
            src={`https://www.arcgis.com/sharing/rest/content/items/b023006af3334d16ba9cff9d746af31d/resources/images/widget_178/1645721198925.jpeg`}
            alt="Second slide"
          />

        </Carousel.Item>
        <Carousel.Item>
          <img
            
            src={`https://img.goraymi.com/2017/03/31/6f5b4483c397ae48f184eb87523bc324_xl.jpg`}
            alt="Third slide"
          />
        </Carousel.Item>
        <Carousel.Item>
          <img
            className="d-block w-100"
            src={`/assets/illustrations/CHIMBORAZO.png`}
            alt="Third slide"
          />
        </Carousel.Item>
      </Carousel>
      </div>

    </>
  );
}

export default Carrusel;
